import React from "react";

const PaginationButton = ({ pageNumber, onClick }) => {
  return (
    <div>
      <div className="container">
        <div className="row">
          <div className="col-2"></div>
          <button className="mx-3 my-5" onClick={onClick}>
            {pageNumber}
          </button>
        </div>
      </div>
    </div>
  );
};

export default PaginationButton;
